import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/GameHome-h.css';
import { AWS_ICON_CATEGORIES } from '../services/IconResolver';

const GameHome = () => {
  return (
    <div className="game-home-container-h">
      <h1 className="game-title-h">AWS Gaming Hub</h1>

      <div className="games-grid-h">
        <Link to="/architecture-game" className="game-card-h">
          <div className="game-icon-h architecture-icon-h"></div>
          <h2>AWS Architecture Challenge</h2>
          <p>Complete cloud architectures by identifying missing services</p>
        </Link>

        <Link to="/cloud-shooter" className="game-card-h">
          <div className="game-icon-h shooter-icon-h"></div>
          <h2>Cloud Shooter</h2>
          <p>Test your AWS knowledge in this fast-paced shooter game</p>
        </Link>
      </div>
    </div>
  );
};

export default GameHome;
